import React from 'react';
import alunos from '../../data/alunos';

export default (props) => {
    return (
        <div>
            <ul>
                {alunos.map((item) => {
                    return <li>{item.id}) {item.name} - {item.nota}</li>;
                })}
            </ul>
        </div>
    )
}
